require 'mini_magick'
require 'base64'

another_data = ""

p 'Hello world'

image = MiniMagick::Image.read(Base64.decode64(another_data))

#image.resize "300x10000"

image.colorspace 'gray'

image.format 'JPEG'

enocoded = Base64.strict_encode64(image.to_blob)

base64_encoded =  "data:image/jpeg;base64,#{enocoded}"

p base64_encoded
